function textBox(props){
    <div className="flex gap-2">
        <span className="text-xl">{props.label}</span>
    </div>
}

function popUpSetTime() {
    return (
          <div className="h-screen w-full bg-black/50 absolute top-0 z-10">
              <div className="max-w-screen-sm mx-auto bg-white rounded flex flex-col">
                <textBox label="test"/>
              </div>
          </div> 
    );
  }
  
  export default popUpSetTime;
